  true,\n\t\"url\": null,\n\t\"notes\": \"WTT - Lite Edition, a Web version of the
  TRC Thermodynamic Tables, represents a collection of critically evaluated thermodynamic
  property data for 150 commonly-used (primarily organic) pure compounds.  Various
  search options based on compound information (empirical formula, partial name, molecular
  weight) are provided. Data presentation features an interactive JavaScript-based
  Web interface with dynamic window-in-window navigation. Dynamic table generation
  based upon user input and interactive data plotting capabilities are also provided.
  Unlimited data retrieval and their local storage and use are permitted.  Complimentary
  WTT-Lite data availability information (properties provided for a given compound,
  ranges of validity, number of experimental data points points) can be accessed by
  those without a subscription at http://wtt-lite.nist.gov.\",\n\t\"license_title\":
